import React from 'react'

const index = ({name,completed,priority}) => {
    
  return (
    <div>
      <input type="checkbox" onChange={(e)=> !completed}
       checked={completed} name="" id="" style={{marginRight:'50px'}}/>
      <label htmlFor="name" style={{marginRight:'50px'}}>{name}</label>
      <label htmlFor="" style={{marginRight:'0px'}}>{priority}</label>
    </div>
  )
}

export default index
